import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Container } from '@mui/material';

export default function Treyder() {
  return (
    <Container>
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Firstname" variant="outlined" />
      <TextField id="outlined-basic" label="Subname" variant="outlined" />
      <TextField id="outlined-basic" label="Lastname" variant="outlined" />
      <TextField id="outlined-basic" label="Lastname" variant="outlined" />
      <TextField id="outlined-basic" label="Gender" variant="outlined" />
      <TextField id="outlined-basic" label="Username" variant="outlined" />
      <TextField id="outlined-basic" label="Email" variant="outlined" />
      <TextField id="outlined-basic" label="Birthdate" variant="outlined" />
      <TextField id="outlined-basic" label="Address name" variant="outlined" />
      <TextField id="outlined-basic" label="Housenumber" variant="outlined" />
      <TextField id="outlined-basic" label="Blocknumber" variant="outlined" />
      <TextField id="outlined-basic" label="Doornumber" variant="outlined" />
      <TextField id="outlined-basic" label="Zipcode" variant="outlined" />
      <TextField id="outlined-basic" label="Country code" variant="outlined" />
      <TextField id="outlined-basic" label="Serialnumber" variant="outlined" />
      <TextField id="outlined-basic" label="Password" variant="outlined" />
      <TextField id="outlined-basic" label="Role" variant="outlined" />
      <TextField id="outlined-basic" label="City" variant="outlined" />



    </Box>
    </Container>
  );
}
